import React from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";

function Header() {
  return (
    <Container>
      <a>
        <HomeIcon />
      </a>
    </Container>
  );
}

export default Header;

const Container = styled.div`
